// HomePage.jsx

import React from 'react';
import { Link } from 'react-router-dom';
import { HiOutlineUserCircle } from 'react-icons/hi'; // Importation de l'icône d'utilisateur de Tailwind CSS
import { signOut } from 'firebase/auth';
import { auth } from  '../firebase-config';

function HomePage() {

  const handleLogout = () => {
    signOut(auth)
      .then(() => {
        console.log('Déconnexion réussie');
        alert('Déconnexion réussie');
        navigate('/');
      })
      .catch((error) => {
        alert(error.message);
      });
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Barre de navigation */}
      <nav className="bg-gray-800 py-4 px-8 flex justify-between items-center">
        <div className="text-white text-xl">Goblo</div>
        <div className="flex items-center">
          <HiOutlineUserCircle className="h-6 w-6 text-white mr-2" />
          <button onClick={handleLogout} className="text-white">Mon compte</button>
        </div>
      </nav>

      {/* Contenu de la page */}
      <div className="container mx-auto px-4 py-8">
        {/* Logo */}
        <div className="text-center mb-8">
          <img className="mx-auto w-20 h-20" src="/logo.png" alt="Logo de l'application" />
        </div>

        {/* Cadres */}
        <div className="grid grid-cols-2 lg:grid-cols-3 gap-4">
          {/* Ajoutez ici vos cadres avec des liens */}
          {/* Exemple : */}
          <Link to="/enrollment" className="border border-gray-300 p-4 rounded-lg flex items-center justify-center bg-gray-200 hover:bg-gray-300 transition duration-300">
            {/* Icône */}
            <img className="w-12 h-12" src="hommes.png" alt="Icône" />
            {/* Texte */}
            <div className="ml-2">
              <div className="font-semibold">Enroller</div>
              <div>Enregistrer les contribuables</div>
            </div>
          </Link>
          {/* Ajoutez d'autres cadres de la même manière */}
        </div>
      </div>

      {/* Copyright */}
      <div className="text-center mt-auto py-8">
        <CopyrightText />
      </div>
    </div>
  );
}

export default HomePage;
